import { useState } from 'react';
import axios from 'axios';

function App() {

  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const submitHandler = e => {
    axios.post('http://localhost:8080/signup', {username: username, password: password}).then((data) => {
      console.log(data);
      setUsername('');
      setPassword('');
    })
  }

  return (
    <div>
      <form className='mx-auto p-9 rounded-2xl bg-theme-orange md:p-12 w-72 md:w=96 mt-36 h-84' onSubmit={submitHandler}>
        <div className='flex justify-between'>
          <img src="/public/images/palm-logo.png" alt="logo" />
          <h3 className='pb-6 text-2xl text-black'>Roommate Finder</h3>
        </div>
        <label className='block mb-1 text-xl text-black' htmlFor='username'>Username</label>
        <input className='w-full h-8 p-1 mb-6 focus:outline-none' id='username' type='text' value={username} onChange={(e) => setUsername(e.target.value)} />
        <label className='block mb-1 text-xl text-black' htmlFor='password'>Password</label>
        <input className='w-full h-8 p-1 mb-6 focus:outline-none' id='password' type='text' value={password} onChange={(e) => setPassword(e.target.value)} />
        <div className='flex justify-center'>
          <button className='px-3 py-1 rounded-sm bg-white' type='submit'>Submit</button>
        </div>
      </form>  
    </div>
  );
}

export default App;
